import { POST_USER_INFO } from './actions';
import axios from 'axios';

export const postUserInfo = (username, email, password) => dispatch => {
        return axios.get('http://127.0.0.1:8000/api/user/' + username), {
            username,
            email,
            password
        }
            .then(res => dispatch ({
                type: POST_USER_INFO,
                res: res
            }))
}
